import React, { useEffect, useState } from "react";
import userImage from "../assets/user.png"; // Add a default user image to the 'assets' folder
import { auth, db } from "../firebase";
import { doc, getDoc } from "firebase/firestore";
import { useNavigate } from "react-router-dom";

const UserDashboard = () => {
  const [userName, setUserName] = useState("User");
  const navigate = useNavigate();

  useEffect(() => {
    const fetchUserData = async () => {
      const user = auth.currentUser;
      if (user) {
        const userDoc = await getDoc(doc(db, "users", user.uid));
        if (userDoc.exists()) {
          setUserName(userDoc.data().name);
        }
      }
    };

    fetchUserData();
  }, []);

  const handleLogout = () => {
    auth.signOut();
    navigate("/login");
  };

  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <div style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "space-between",
        padding: "10px",
        backgroundColor: "#efc3e6",
        border: "1px solid #ddd",
        borderRadius: "10px",
        marginBottom: "20px",
      }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img
            src={userImage}
            alt="User"
            style={{ height: "50px", width: "50px", borderRadius: "50%", marginRight: "10px" }}
          />
          <h2>Welcome, {userName}!</h2>
        </div>

        
<button class="Btn" onClick={handleLogout} style={{ padding: "5px 10px", cursor: "pointer" }}>
  <div class="sign"><svg viewBox="0 0 512 512"><path d="M377.9 105.9L500.7 228.7c7.2 7.2 11.3 17.1 11.3 27.3s-4.1 20.1-11.3 27.3L377.9 406.1c-6.4 6.4-15 9.9-24 9.9c-18.7 0-33.9-15.2-33.9-33.9l0-62.1-128 0c-17.7 0-32-14.3-32-32l0-64c0-17.7 14.3-32 32-32l128 0 0-62.1c0-18.7 15.2-33.9 33.9-33.9c9 0 17.6 3.6 24 9.9zM160 96L96 96c-17.7 0-32 14.3-32 32l0 256c0 17.7 14.3 32 32 32l64 0c17.7 0 32 14.3 32 32s-14.3 32-32 32l-64 0c-53 0-96-43-96-96L0 128C0 75 43 32 96 32l64 0c17.7 0 32 14.3 32 32s-14.3 32-32 32z"></path></svg></div>
  <div class="text">Logout</div>
</button>





        <button onClick={handleLogout} style={{ padding: "5px 10px", cursor: "pointer" }}>
          <div class="sign"><svg viewBox="0 0 512 512"><path d="M377.9 105.9L500.7 228.7c7.2 7.2 11.3 17.1 11.3 27.3s-4.1 20.1-11.3 27.3L377.9 406.1c-6.4 6.4-15 9.9-24 9.9c-18.7 0-33.9-15.2-33.9-33.9l0-62.1-128 0c-17.7 0-32-14.3-32-32l0-64c0-17.7 14.3-32 32-32l128 0 0-62.1c0-18.7 15.2-33.9 33.9-33.9c9 0 17.6 3.6 24 9.9zM160 96L96 96c-17.7 0-32 14.3-32 32l0 256c0 17.7 14.3 32 32 32l64 0c17.7 0 32 14.3 32 32s-14.3 32-32 32l-64 0c-53 0-96-43-96-96L0 128C0 75 43 32 96 32l64 0c17.7 0 32 14.3 32 32s-14.3 32-32 32z"></path></svg></div>
        <div class="text">Logout</div></button>
      </div>

      {/* Menu Card Container */}
      <div style={{
        margin: "20px",
        padding: "20px",
        border: "1px solid #ddd",
        borderRadius: "10px",
        backgroundColor: "#ffc8dd",
      }}>
        <div style={{
          display: "flex",
          justifyContent: "space-between",
          gap: "10px",
        }}>
          {/* Starter Section */}
          <div style={{ flex: 1, padding: "20px", border: "1px solid #ccc", borderRadius: "8px", backgroundColor: "#fff" }}>
            <h3>Starters</h3>
            <div style={{ margin: "10px 0" }}>
              <img src="/beer.png" alt="Starter 1" style={{ width: "100px", height: "100px", borderRadius: "8px" }} />
              <p>Item 1 - $5.99 <button>Add</button></p>
            </div>
            <div style={{ margin: "10px 0" }}>
              <img src="/starter2.jpg" alt="Starter 2" style={{ width: "100px", height: "100px", borderRadius: "8px" }} />
              <p>Item 2 - $6.99 <button>Add</button></p>
            </div>
            <div style={{ margin: "10px 0" }}>
              <img src="/starter3.jpg" alt="Starter 3" style={{ width: "100px", height: "100px", borderRadius: "8px" }} />
              <p>Item 3 - $4.99 <button>Add</button></p>
            </div>
          </div>

          {/* Main Course Section */}
          <div style={{ flex: 1, padding: "20px", border: "1px solid #ccc", borderRadius: "8px", backgroundColor: "#fff" }}>
            <h3>Main Course</h3>
            <div style={{ margin: "10px 0" }}>
              <img src="/main1.jpg" alt="Main 1" style={{ width: "100px", height: "100px", borderRadius: "8px" }} />
              <p>Item 1 - $10.99 <button>Add</button></p>
            </div>
            <div style={{ margin: "10px 0" }}>
              <img src="/main2.jpg" alt="Main 2" style={{ width: "100px", height: "100px", borderRadius: "8px" }} />
              <p>Item 2 - $12.99 <button>Add</button></p>
            </div>
            <div style={{ margin: "10px 0" }}>
              <img src="/main3.jpg" alt="Main 3" style={{ width: "100px", height: "100px", borderRadius: "8px" }} />
              <p>Item 3 - $9.99 <button>Add</button></p>
            </div>
